import React from 'react'
import { useNavigate } from "react-router-dom";

function Radio(props){
    const navigate = useNavigate()

    function linkContact(){
        navigate("/Contact")
    }

    function linkAboutMe(){
        navigate("/Average-Order")
    }

    function linkProject(){
        navigate("/")
    }

    function linkHome(){
        navigate("/Track")
    }



    return(
        <div class="radio-inputs">

        <label class="radio">
            <input className='rc' type="checkbox" name='Home' onChange={linkHome} checked={props.HOME}/>
            <span class="name">Home</span>
        </label>

        <label class="radio">
            <input className='rc' type="checkbox" name='AboutMe' onChange={linkAboutMe} checked={props.YT}/>
            <span class="name">About Me</span>
        </label>

        <label class="radio">
            <input className='rc' type="checkbox"  name='Project' onChange={linkProject} checked={props.AOV}/>
            <span class="name">Projects</span>
        </label>


        <label class="radio">
            <input className='rc' type="checkbox" name='Contact' onChange={linkContact} checked={props.WNC}/>
            <span class="name">Contact</span>
        </label>

        </div>
    )
}


export default Radio


